import React from "react";
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
} from "@mui/material";
const AgendaLitigationAMS = () => {
  const eventData = [
    {
      time: "9:00 - 9:15",
      welcom: "Welcome Note",
      event:
        "Dr. Amit Goel, Director and Co-Founder  - Director at GLA (India)",
    },
    // Add other events here
  ];
  return (
    <div>
      <div
        style={{
          textAlign: "center",
          padding: "10px",
          background: "#C82D39",
          margin: "10px",
          color: "white",
          fontWeight: "700",
        }}
      >
        Day 1: Sep 4, 2023
      </div>
      <div style={{ display: "flex", marginLeft: "6rem", marginRight: "6rem" }}>
        <div
          style={{
            width: "20%",
            textAlign: "center",
            padding: "10px",
            margin: "10px",
            background: "#0092C8",
            color: "white",
            fontWeight: "700",
            height: "3rem",
          }}
        >
          9:00 - 9:15
        </div>
        <div
          style={{
            width: "80%",
            // textAlign: "center",
            padding: "10px",
            background: "#848484",
            margin: "10px",
            color: "white",
            fontWeight: "700",
          }}
        >
          <span style={{ fontWeight: 700, color: "red" }}>
            Welcome Note: &nbsp;
          </span>
          <span style={{ fontWeight: 600 }}>Dr. Amit Goel, &nbsp;</span>
          <span style={{ fontWeight: 400 }}>
            Director and Co-Founder - Director at GLA (India)
          </span>
        </div>
      </div>
      <div style={{ display: "flex", marginLeft: "6rem", marginRight: "6rem" }}>
        <div
          style={{
            width: "20%",
            textAlign: "center",
            padding: "10px",
            margin: "10px",
            background: "#0092C8",
            color: "white",
            fontWeight: "700",
            height: "3rem",
          }}
        >
          9:15 - 10:30
        </div>
        <div
          style={{
            width: "80%",
            textAlign: "center",
            padding: "10px",
            background: "#848484",
            margin: "10px",
            color: "white",
            fontWeight: "700",
          }}
        >
          <span style={{ fontWeight: 700, color: "red" }}>
            Session 1(A): &nbsp;
          </span>
          <span style={{ fontWeight: 600 }}>Litigation Management, &nbsp;</span>
          <span style={{ fontWeight: 400 }}>
            Strategies For Aligning Cost With Value{" "}
          </span>
        </div>
      </div>
    </div>
  );
};

export default AgendaLitigationAMS;
